  \"\",\n\t\t\"description\": \"The Forest Canopy Cover (CC) layer describes the percent
  cover of the tree canopy in a stand. Specifically, canopy cover describes the vertical
  projection of the tree canopy onto an imaginary horizontal surface representing
  the ground's surface. CC is generated using a predictive modeling approach that
  relates Landsat imagery and spatially explicit biophysical gradients to calculated
  values of average canopy cover from field training sites and digital orthophoto
  quadrangles. CC supplies information to fire behavior models to determine surface
  fuel shading for calculating dead fuel moisture and for calculating wind reductions.\",\n\t\t\"format\":
  \"HTML\",\n\t\t\"tracking_summary\": {\n\t\t\t\"total\": 5,\n\t\t\t\"recent\": 1\n\t\t},\n\t\t\"mimetype_inner\":
