  \"\",\n\t\t\"description\": \"The Forest Canopy Height (CH) layer describes the
  average height of the top of the vegetated canopy and is provided for forested areas
  only. CH measurement units are meters * 10. CH is generated using a predictive modeling
  approach that relates Landsat imagery and spatially explicit biophysical gradients
  to calculated values of average dominant height from field training sites. CH supplies
  information to fire behavior models to determine the probability of crown fire ignition,
  calculate wind reductions, and compute the volume of crown fuel.\",\n\t\t\"format\":
  \"HTML\",\n\t\t\"tracking_summary\": {\n\t\t\t\"total\": 2,\n\t\t\t\"recent\": 1\n\t\t},\n\t\t\"mimetype_inner\":
