  \"2015-11-18T09:34:23.552733\",\n\t\"name\": \"u-s-forest-service-landfire-canopy-fuel\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"LANDFIRE canopy fuel data describe the composition
  and characteristics of wildland surface fuel and can be implemented within models
  to predict wildland fire behavior and effects. LANDFIRE fuel products are useful
  for strategic fuel treatment prioritization and tactical assessment of fire behavior
  and effects. They provide consistent fuel data to support fire planning, analysis,
  and budgeting to evaluate fire management alternatives supplement strategic and
  tactical planning for fire operations.\",\n\t\"license_title\": \"Creative Commons
